function print_international_day()
    url = 'https://www.downloadexcelfiles.com/sites/default/files/docs/list_of_international_days-2605j.xlsx';
    try
        today = datetime(date());
        data = webread(url);
        data = data(data.Day.Day == today.Day & data.Day.Month == today.Month, :);
        for i = 1:numel(data.Name)
